// import { confirmAlert } from 'react-confirm-alert'; // Import
import 'react-confirm-alert/src/react-confirm-alert.css'
import TopNavigation from './topNavigation'
import ShortMenu from './list'
import Routes from './routes'

function App() {
  return (
    <div>
      <TopNavigation />
      <ShortMenu />
      <main>
        <Routes />
      </main>
    </div>
  );
}

export default App;
